import user from './components/user';
import userexpenses from './components/userexpenses';
import allexpenses from './components/allexpenses';

function App() {
  return (
    <div>
      <h1>Expense Tracker</h1>
      <user />
      <userexpenses/>
      <allexpenses />
    </div>
  );
}

export default App;
